Randomly generate a Base58 encoded 256-bit string (seed): Option 1: Generate your seed with a true random number generator (recommended for production usage). Option 2: Use the build in HORNET seed generator: hornet tool seedgen. Switch on the autopeering mode in your config.json: /var/lib/hornet/config.json ...
"network": { ... "autopeering": { "bindAddress": "0.0.0.0:14626", "runAsEntryNode": true, "seed": "7xFNTP5Fc3wnD78LarNTrvRoKiLESA9qecn3eR5HSVBj" }
}
... Start HORNET with sudo service start hornet && sudo journalctl -n hornet -f. HORNET will start in an autopeering entry node only mode. Other functions are disabled in this mode. In the HORNET logs, you will see something like this: INFO Autopeering Autopeering started: ID=a0ba6bf62d6fe911 Address=0.0.0.0:14626/udp PublicKey=9CT42uZC6GetwoT2Jz7Lc5t6LGvXphp9gLvEsdoXEizV Note down your PublicKey. Your entry node address is <PublicKey>@<your-domain.tld>:<autopeering-port> Add your entry node address to the network.autopeering.entryNodes in your nodes config.json Done, your nodes should now autopeer with the help of your entry node.
